INSERT INTO `InvoiceTemplates` VALUES (6,'Básica','Factura sin detalle de llamadas','<!DOCTYPE HTML>\r\n<html>\r\n<head>\r\n    <style>\r\n        body {\r\n            font-size: 11px;\r\n            font-family: Helvetica Neue,Helvetica,Arial,sans-serif;\r\n        }\r\n        h2 {\r\n            font-size: 15px;\r\n        }\r\n        div{\r\n            page-break-inside: avoid;\r\n        }\r\n        div.theader {\r\n            width: 100%;\r\n            text-align: center;\r\n            margin: 25px 0 0;\r\n            font-weight: bold;\r\n            font-size: 20px;\r\n            border: none;\r\n            padding-bottom: 5px;\r\n            border-bottom: 1px solid black;\r\n        }\r\n        div.table {\r\n            display: table;\r\n            margin-bottom: 5px;\r\n            text-align: center;\r\n            border: none;\r\n            border-collapse: collapse;\r\n            width: 100%;\r\n            table-layout: fixed;\r\n        }\r\n        div.tbody {\r\n            display: table-row-group;\r\n        }\r\n        div.table div.tr {\r\n            display: table-row;\r\n            border: 1px solid black;\r\n            page-break-inside: avoid;\r\n        }\r\n        div.table div.th {\r\n            display: table-cell;\r\n            border-right: 1px solid black;\r\n            background-color: black;\r\n            border-bottom: 1px solid black;\r\n            color: white;\r\n            font-weight: bold;\r\n            padding: 5px 0 2px;\r\n        }\r\n        div.table div.tr:not(:last-child) div.th {\r\n            border-bottom: 1px solid white;\r\n        }\r\n        div.table div.tr div.th:not(:last-child) {\r\n            border-right: 1px solid white;\r\n        }\r\n        div.table div.td {\r\n            display: table-cell;\r\n            width: 50%;\r\n            padding: 5px 0 5px;\r\n            font-weight: normal;\r\n            background-color: white;\r\n            border: 1px solid black;\r\n            color: black;\r\n        }\r\n        .bold {\r\n            font-weight: bold!important;\r\n        }\r\n        .center {\r\n            text-align: center!important;\r\n        }\r\n        .left {\r\n            float: left!important;\r\n        }\r\n        .noBorder {\r\n            border: none!important;\r\n        }\r\n        .clientData {\r\n            width: 60%;\r\n            float: left;\r\n        }\r\n        .clientData h2 {\r\n            margin: 0;\r\n        }\r\n        .clientData p {\r\n            margin: 0px 0px 0px 20px;\r\n            padding: 0;\r\n        }\r\n        .invoiceData {\r\n            width: 30%;\r\n            float: right;\r\n            text-align: right;\r\n        }\r\n        .invoiceData p {\r\n            margin: 0;\r\n            padding: 0;\r\n        }\r\n        .clearFloats {\r\n            clear:both;\r\n        }\r\n        #content {\r\n            margin: 10px 0;\r\n        }\r\n        #subheader .left {\r\n            width: 60%;\r\n            font-weight: bold;\r\n        }\r\n        #subheader .left p {\r\n            font-size: 32px;\r\n            margin-top: 0;\r\n        }\r\n        #subheader .right {\r\n            width: 35%;\r\n            text-align: right;\r\n            float: right;\r\n        }\r\n        #subheader .right p.title {\r\n            margin: 0px;\r\n            padding: 0;\r\n            font-weight: bold;\r\n            font-size: 17px;\r\n        }\r\n        #subheader .right p.date {\r\n            margin: 0;\r\n            padding: 0;\r\n            font-size: 13px;\r\n        }\r\n        #content > div.table {\r\n            text-align: center;\r\n            width: 50%;\r\n            float: right;\r\n            border: none;\r\n            border-collapse: collapse;\r\n        }\r\n        #callsPerTypeSummary > div.table {\r\n            text-align: center;\r\n            width: 100%;\r\n        }\r\n        #content {\r\n            width: 100%;\r\n        }\r\n        #fixedCosts > div.table {\r\n            clear: both;\r\n        }\r\n        #fixedCosts div.table div.td {\r\n            width: 25%;\r\n        }\r\n        #summary {\r\n            width: 50%;\r\n            float: right;\r\n        }\r\n        #callsPerTypeSummary div.td {\r\n            width: 25%;\r\n        }\r\n        #callsPerType div.td {\r\n            width: 20%;\r\n        }\r\n    </style>\r\n    <meta charset=\"UTF-8\">\r\n</head>\r\n<body>\r\n<div id=\"content\">\r\n    <div id=\"subheader\">\r\n        <div class=\"left\">\r\n            <p class=\"left\">Factura</p>\r\n        </div>\r\n        <div class=\"right\">\r\n            <p class=\"title\">Fecha</p>\r\n            <p class=\"date\">{{invoice.invoiceDate}}</p>\r\n        </div>\r\n    </div>\r\n    <div>\r\n        <div class=\"clientData\">\r\n            <h2>Cliente</h2>\r\n            <p>{{company.name}}</p>\r\n            <p>{{company.postalAddress}}</p>\r\n            <p>{{company.postalCode}} {{company.town}}, {{company.province}} </p>\r\n            <p>NIF / CIF: {{company.nif}}</p>\r\n        </div>\r\n        <div class=\"invoiceData\">\r\n            <p class=\"bold\">Nº de factura</p>\r\n            <p>{{invoice.number}}</p>\r\n            <p class=\"bold\">Periodo de facturación</p>\r\n            <p>{{invoice.inDate}} - {{invoice.outDate}}</p>\r\n        </div>\r\n    </div>\r\n    <br class=\"clearFloats\" />\r\n    <div id=\"summary\">\r\n        <div class=\"theader center\">Resumen</div>\r\n        <div class=\"table\">\r\n            <div class=\"tbody\">\r\n                {{#if fixedCostsTotals}}\r\n                <div class=\"tr bold center\">\r\n                    <div class=\"th\">Costes fijos</div>\r\n                    <div class=\"td bold\">\r\n                        {{fixedCostsTotals}} €\r\n                    </div>\r\n                </div>\r\n                {{/if}}\r\n                <div class=\"tr bold center\">\r\n                    <div class=\"th\">Llamadas</div>\r\n                    <div class=\"td bold\">{{callData.callSumaryTotals.totalPrice}} €</div>\r\n                </div>\r\n                <div class=\"tr bold\">\r\n                    <div class=\"th\">Total:</div>\r\n                    <div class=\"td bold\">{{totals.totalPrice}} €</div>\r\n                </div>\r\n                <div class=\"tr bold\">\r\n                    <div class=\"th\">IVA aplicable</div>\r\n                    <div class=\"td bold\">{{invoice.taxRate}} %</div>\r\n                </div>\r\n                <div class=\"tr bold\">\r\n                    <div class=\"th\">IVA</div>\r\n                    <div class=\"td bold\">{{totals.totalTaxes}} €</div>\r\n                </div>\r\n                <div class=\"tr bold\">\r\n                    <div class=\"th\">Total con IVA</div>\r\n                    <div class=\"td bold\">{{totals.totalWithTaxes}} €</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <br class=\"clearFloats\" />\r\n\r\n    {{#if fixedCosts.length}}\r\n        <div id=\"fixedCosts\">\r\n            <div class=\"theader\">Costes fijos</div>\r\n            <div class=\"table\">\r\n                <div class=\"tbody\">\r\n                    <div class=\"tr\">\r\n                        <div class=\"th\">Concepto</div>\r\n                        <div class=\"th\">Precio</div>\r\n                        <div class=\"th\">Cantidad</div>\r\n                        <div class=\"th\">Subtotal</div>\r\n                    </div>\r\n                    {{#each fixedCosts}}\r\n                        <div class=\"tr\">\r\n                            <div class=\"td\">\r\n                                {{name}}\r\n                                {{#if description}}\r\n                                    <br />\r\n                                    {{description}}\r\n                                {{/if}}\r\n                            </div>\r\n                            <div class=\"td\">{{cost}} €</div>\r\n                            <div class=\"td\">{{quantity}}</div>\r\n                            <div class=\"td\">{{subTotal}} €</div>\r\n                        </div>\r\n                    {{/each}}\r\n                    <div class=\"tr noBorder\">\r\n                        <div class=\"td noBorder\"></div>\r\n                        <div class=\"td noBorder\"></div>\r\n                        <div class=\"th\" style=\"border-right: 1px solid black;\">Total:</div>\r\n                        <div class=\"td bold\">{{fixedCostsTotals}} €</div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    {{/if}}\r\n\r\n    <div id=\"callsPerTypeSummary\">\r\n        <div class=\"theader\">Resumen de llamadas por tipo</div>\r\n        <div class=\"table\">\r\n            <div class=\"tbody\">\r\n                <div class=\"tr\">\r\n                    <div class=\"th\">Tipo</div>\r\n                    <div class=\"th\">Nº llamadas</div>\r\n                    <div class=\"th\">Duración total</div>\r\n                    <div class=\"th\">Precio total</div>\r\n                </div>\r\n                {{#each callData.callSumary}}\r\n                <div class=\"tr\">\r\n                    <div class=\"td white\">{{type}}</div>\r\n                    <div class=\"td white\">{{numberOfCalls}}</div>\r\n                    <div class=\"td white\">{{totalCallsDurationFormatted}}</div>\r\n                    <div class=\"td white\">{{totalPrice}} €</div>\r\n                </div>\r\n                {{/each}}\r\n                <div class=\"tr bold\">\r\n                    <div class=\"th\" style=\"border-right: 1px solid black;\">Totales:</div>\r\n                    <div class=\"td bold\" style=\"border-left: 1px solid black;\">{{callData.callSumaryTotals.numberOfCalls}}</div>\r\n                    <div class=\"td bold\">{{callData.callSumaryTotals.totalCallsDurationFormatted}}</div>\r\n                    <div class=\"td bold\">{{callData.callSumaryTotals.totalPrice}} €</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</body>\r\n</html>','<!DOCTYPE HTML>\r\n<html>\r\n<head>\r\n    <style>\r\n        body {\r\n            font-size: 11px;\r\n            font-family: Helvetica Neue,Helvetica,Arial,sans-serif;\r\n            padding-top: 45px;\r\n            border-bottom: 1px solid red;\r\n            margin: 45px 8px 0;\r\n        }\r\n        .bold {\r\n            font-weight: bold!important;\r\n        }\r\n        .center {\r\n            text-align: center!important;\r\n        }\r\n        .left {\r\n            float: left!important;\r\n        }\r\n        #header {\r\n            text-align: right;\r\n            height: 50px;\r\n        }\r\n        #header img {\r\n            float: left;\r\n            height: 30px;\r\n        }\r\n        #header p {\r\n            margin: 0;\r\n        }\r\n        #header .redLine {\r\n            border-color: red;\r\n            border-width: 0 0 1px 0;\r\n        }\r\n    </style>\r\n    <meta charset=\"UTF-8\">\r\n</head>\r\n<body>\r\n<div id=\"header\">\r\n    <div>\r\n        <img src=\"{{brand.logoPath}}\">\r\n        <div>\r\n            <p class=\"bold\">{{brand.name}}</p>\r\n            <p class=\"bold\">{{brand.postalAddress}}, {{brand.postalCode}} {{brand.town}}, {{brand.province}} </p>\r\n            <p>NIF / CIF: {{brand.nif}}</p>\r\n        </div>\r\n        <div class=\"redLine\">\r\n        </div>\r\n    </div>\r\n</div>\r\n</body>\r\n</html>','<!DOCTYPE HTML>\r\n<html>\r\n   <head>\r\n       <style>\r\n           #registryData {\r\n              border-top: 1px solid red;\r\n         	  border-bottom: 1px solid red;\r\n              line-height: 18px;\r\n              font-size: 8px;\r\n              padding: 3px 0;\r\n              text-align: center;\r\n           }\r\n           #footer {\r\n         	  padding-bottom: 20px;\r\n              text-align: right;\r\n              font-size: 14px;\r\n              font-weith:bold;\r\n           }\r\n       </style>\r\n       <meta charset=\"UTF-8\">\r\n   </head>\r\n   <body>\r\n     <p id=\"registryData\">\r\n        {{brand.registryData}}\r\n     </p>\r\n     <div id=\"footer\">\r\n       <p>\r\n         <span id=\"page\"></span>\r\n         / <span id=\"topage\"></span>\r\n       </p>\r\n     </div>\r\n    <script>\r\n      var vars = {};\r\n      var query_strings_from_url = document.location.search.substring(1).split(\'&\');\r\n      for (var query_string in query_strings_from_url) {\r\n          if (query_strings_from_url.hasOwnProperty(query_string)) {\r\n              var temp_var = query_strings_from_url[query_string].split(\'=\', 2);\r\n              vars[temp_var[0]] = decodeURI(temp_var[1]);\r\n          }\r\n      }\r\n      document.getElementById(\'page\').innerHTML = vars.page;\r\n      document.getElementById(\'topage\').innerHTML = vars.topage;\r\n    </script>\r\n    </body>\r\n</html>',1),(7,'Completa','Factura con detalle de llamadas','<!DOCTYPE HTML>\r\n<html>\r\n<head>\r\n    <style>\r\n        body {\r\n            font-size: 11px;\r\n            font-family: Helvetica Neue,Helvetica,Arial,sans-serif;\r\n        }\r\n        h2 {\r\n            font-size: 15px;\r\n        }\r\n        div{\r\n            page-break-inside: avoid;\r\n        }\r\n        div.theader {\r\n            width: 100%;\r\n            text-align: center;\r\n            margin: 25px 0 0;\r\n            font-weight: bold;\r\n            font-size: 20px;\r\n            border: none;\r\n            padding-bottom: 5px;\r\n            border-bottom: 1px solid black;\r\n        }\r\n        div.table {\r\n            display: table;\r\n            margin-bottom: 5px;\r\n            text-align: center;\r\n            border: none;\r\n            border-collapse: collapse;\r\n            width: 100%;\r\n            table-layout: